    Lidar Survey of the Alabama, Mississippi, and Southeast Louisiana Barrier Islands,
    from September 5 to October 11, 2012 -- Classified Point Data",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-02-10T06:16:32.049719",nt"name": "topographic-lidar-survey-of-the-alabama-mississippi-and-southeast-louisiana-barrier-islands-froead19",nt"isopen":
    false,nt"url": null,nt"notes": "This Data Series Report contains lidar
    elevation data collected September 5 to October 11, 2012, for the barrier islands
    of Alabama, Mississippi and southeast Louisiana, including the coast near Port Fourchon.
    Most of the data were collected September 5-10, 2012, with a reflight conducted
    on October 11, 2012, to increase point density in some areas. Lidar data exchange
    format (LAS) 1.2 formatted point data files were generated based on these data.
    The point cloud data were processed to extract bare earth data; therefore, the point
    cloud data are organized into only four classes: 1-unclassified, 2-ground, 7-noise
    and 9-water. Aero-Metric, Inc., was contracted by the U.S. Geological Survey (USGS)
    to collect and process these data. The lidar data were collected at a nominal pulse
    spacing (NPS) of 1.0 meter (m). The horizontal projection and datum of the data
    are Universe Transverse Mercator, zones 15N and 16N, North American Datum 1983 (UTM
    Zone 15N or 16N NAD83), meters. The vertical datum is North American Vertical Datum
    1988, Geoid 2012 (NAVD88, GEOID12), meters. These lidar data are available to Federal,
    State and local governments, emergency-response officials, resource managers, and
    the general public.",nt"license_title": null,nt"extras": [{ntt"key":
